//! ポケモンのデータを保持する。

use std::collections::HashMap;

use serde::Deserialize;

use super::moves::*;

#[derive(Debug)]
pub struct PokemonInfo {
    pub no: String,
    pub name: String,
    pub types: Vec<MoveType>,

    // 個体値
    pub attack: i32,
    pub defense: i32,
    pub stamina: i32,

    // 技
    pub fast_moves: Vec<&'static FastMove>,
    pub charge_moves: Vec<&'static ChargeMove>,
}

#[derive(Debug, Deserialize)]
pub struct PokemonJson {
    pub no: String,
    pub name: String,
    pub types: Vec<String>,

    // 個体値
    pub attack: i32,
    pub defense: i32,
    pub stamina: i32,

    // 技
    pub fast_moves: Vec<String>,
    pub charge_moves: Vec<String>,
}

pub fn load_pokemon_info() -> HashMap<String, PokemonInfo> {
    let fast_move_map = get_fast_move_map_by_no();
    let charge_move_map = get_charge_move_map_by_no();

    let mut mp = HashMap::new();

    let data: Vec<PokemonJson> = serde_json::from_str(POKEMON_INFO_JSON).unwrap();

    for d in data {
        let mut types = vec![];
        for tp in d.types {
            types.push(MoveType::from(&*tp));
        }

        let mut fast_moves = vec![];
        for no in d.fast_moves {
            fast_moves.push(fast_move_map[&no]);
        }

        let mut charge_moves = vec![];
        for no in d.charge_moves {
            charge_moves.push(charge_move_map[&no]);
        }

        let name = d.name.clone();

        let p = PokemonInfo {
            no: d.no,
            name: d.name,
            types,

            attack: d.attack,
            defense: d.defense,
            stamina: d.stamina,

            fast_moves,
            charge_moves
        };

        mp.insert(name, p);
    }

    mp
}

#[test]
fn test_load_pokemon_info() {
    let poke_info = load_pokemon_info();

    let p = poke_info.get("ギャラドス").unwrap();

    assert_eq!(p.no, "0130");
    assert_eq!(p.name, "ギャラドス");
    assert_eq!(p.types, vec![MoveType::Water, MoveType::Flying]);
    assert_eq!(p.attack, 237);
    assert_eq!(p.defense, 186);
    assert_eq!(p.stamina, 216);
    assert_eq!(p.fast_moves.iter().map(|m| m.name).collect::<Vec<_>>(), vec!["かみつく", "たきのぼり", "りゅうのいぶき", "ドラゴンテール"]);
    assert_eq!(p.charge_moves.iter().map(|m| m.name).collect::<Vec<_>>(), vec!["ハイドロポンプ", "かみくだく", "げきりん", "たつまき", "りゅうのはどう", "アクアテール", "やつあたり", "おんがえし"]);
}

